import {Link} from 'react-router-dom';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';



const Table = () => {
  function createData(

    name: string,
    amount: number,
  ) {
    return { name, shipTo, paymentMethod, amount };
  }

  return (
    <Container>
    <Box>
    <Box
      sx={{ 
        margin: 2, 
        borderRadius: 2, 
        bgcolor: '#ECEBEB',
        height: '100%',
        display:"flex",
        flexDirection:"column"
      }}>

      <Grid container spacing={2}>
        <Grid item xs={2}>
          <Link to="/">
            <Button variant="outlined" color="primary" >
              <Typography variant="h4">Back</Typography>
            </Button>
          </Link>
        </Grid>

        <Grid item xs={8}>
          <Typography 
          variant="h3" 
          component="h1" 
          align="center"
          noWrap
          >
            View Cart
          </Typography>
        </Grid>

      </Grid>
    </Box>

    <Box
      sx={{ 
        margin: 2, 
        borderRadius: 2, 
        bgcolor: '#ECEBEB',
        display:"flex",
        flexDirection:"column"
      }}>
      <Table></Table>
      <Button variant="outlined">
        Order
      </Button>
    </Box>
    </Box>
    </Container>

    )
}

export default Table;
